  state = {};
  render() {
    return (
      <div className="mod-profile">
        <div className="row">
          <div className="col">
            <div className="row">
              <div className="col-lg ml-4 ">
                <i className="fa fa-file-text float-left mt-2"></i>
                <p className="ml-4">Bio</p>
              </div>
            </div>
            <div className="row">
              <div className="col-lg">
                <div class="input-group">
                  <div class="input-group-prepend">
                    <span
                      class="input-group-text"
                      style={{
                        background: "white",
                        border: "none",
                        color: "black"
                      }}
                    >
                      Name :
                    </span>
                  </div>
                  <input
                    type="text"
                    aria-label="First name"
                    class=" shadow-none"
                    style={{ border: "none" }}
                    value ="Hamna Zaidah"
                  />
                </div>
                {/* <input type="text" value="aa"  /> */}
                {/* <p>Name : Hamnah Zaidah</p>
                               <p>Born : 23,August 2001</p>
                               <p>Hobby : Write & Reading</p>
                               <p>Description : Orang yang bersyukur adalah orang yang tahu cara menikmati hidup </p> */}
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ProfileModal;
